import { useState } from 'react'

const App = () => {
  const [persons, setPersons] = useState([
    { name: 'Arto Hellas', number: '040-123456', id: 1 },
    { name: 'Ada Lovelace', number: '39-44-5323523', id: 2 },
    { name: 'Dan Abramov', number: '12-43-234345', id: 3 },
    { name: 'Mary Poppendieck', number: '39-23-6423122', id: 4 }
  ])
  const [newName, setNewName] = useState('')
  //phone numbers
  const [newPhoneNumber, setNewPhoneNumber] = useState('')
  //filter 
  const [searchName, setFilterName] = useState('')

  //console.log(persons.length)

  const addInfo = (e)=>
  {

    e.preventDefault()

    const nameObject = 
    {
      name:newName,
      number:newPhoneNumber,
      id: persons.length+1
    }

    //check if a person name is already in the system
    if(persons.map((p)=>p.name).includes(newName))
    {
      alert(`${newName} is already added to phonebook`)
    }
    //if name isn't in the system then all the data from the new nameObject is sent to setPerson
    else{
      alert('ok')
      setPersons(persons.concat(nameObject))
      setNewName('')
      setNewPhoneNumber('')
    }
  }


  const handleNameChange = (e)=>{
    //console.log(e.target.value)
    //e.target.value is the value being put into the form
    setNewName(e.target.value)
  }

  const handleNumChange =  (e)=>{
    setNewPhoneNumber(e.target.value)
  }

  const handleFilterChange =  (e)=>{
    setFilterName(e.target.value)
  }

  const Person = (props)=>{
    return(
      <h3>{props.name} {props.number}</h3>
    )

  }

  const Filtered = (props)=>{
    return(
      <h3>{props.name} {props.number}</h3>
    )

  }

  const filterPeople = (e)=>{
    e.preventDefault()

    const nameObject = 
    {
      name:searchName
    }

    if(persons.map((p)=>p.name).includes(searchName)){
        return <div>Hi</div>
        console.log('working')
    }
    //(persons.map((p)=>p.name).includes(newName)
    console.log(e.target.value)
  }

  return (
    <div>
      <form onSubmit={filterPeople}>
      <div>Filter shown with: <input value={searchName}  onChange={handleFilterChange}/></div>

      </form>
      <h2>Phonebook</h2>
      <form onSubmit={addInfo}>
        <div>name: <input value={newName} onChange={handleNameChange}/></div>
        <div>number: <input value={newPhoneNumber} onChange={handleNumChange}/></div>
        <div><button type="submit">add</button></div>
      </form>

      <h2>Numbers</h2>
      {persons.map(p=> <Person key={p.name} name={p.name} number={p.number}/>)}
    </div>
  )
}



export default App

